    axios({
      method: 'GET',
      url: 'http://localhost:8800/63a2ef39670ab130d889cc1b',
      
    }).then(response => {
        console.log(response.data);
        console.log(response.data.text);
        setPost(response.data.text)
      }, (error) => {
      console.log(error);
    });}, [])

  return (
    <div>
      <h1>{post}</h1>
    </div>
  )
}


export default Result;
